impl Solution {
    pub fn repeated_string_match(a: String, b: String) -> i32 {
        for i in 0..((b.len() / a.len() + 1) + 2) {
            // dbg!(&a.repeat(i));
            if a.repeat(i).contains(&b) {
                return i as i32;
            }
        }
        -1
    }
}

struct Solution;

use utils::logger::init_logger;

fn main() {
    init_logger();
    tracing::info!(
        "{}",
        Solution::repeated_string_match("a".to_string(), "".to_string())
    );
}
